function viewTable() {
    this.clear();
    var sql = "SELECT * FROM " + this.get('dbTable').textString + ' ' + 
        this.get('options').textString;
    var cmd = {database: this.get('dbName').textString,
        query: sql};
    var data = JSON.parse(new WebResource(this.get('dbHost').textString +
        '/all').post(JSON.stringify(cmd)).content);
    if (data.length > 0) {
        debugger
        if (data[0].constructor.name === "Object") {
            var i = 1;
            for (prop in data[0]) {
                if (i > this.get('dataGrid').numCols) { break };
                this.get('col'+i++).textString = prop;
            }
            while (i <= this.get('dataGrid').numCols) {
                this.get('col'+i++).textString = '---';
            }
        }
    }
    this.get('dataGrid').setData(data);
}

